import './App.css';
import data from './input.json';

function App() {
  const renderJson = element => {
    var children = element.children;
    return (
      <ul>
        <li> {element.type} </li>
        <li> {element.title} </li>
        {children !== undefined && children.map((child) => (
          renderJson(child)
        ))}
      </ul>
    )
  }
  return (
      <div>
        {data.map((element) => (
          renderJson(element)
        ))}
      </div>
  );
}

export default App;
